import styled from 'styled-components';

export const StyledDisplay = styled.div`
    box-sizing: border-box;
    display: flex;
    align-items: center;
    margin: 0 0 20px 0;
    padding: 20px;
    border: 4px solid #333;
    min-height: 60px;
    width: 100%;
    border-radius: 25px;
    background: #000;
    font-family: Pixel, Arial;
    font-size: 0.8rem;

`;
